message:
Good afternoon, this Mac came in for repair of the headset not working on one side, I fixed it by changing the U6201. In the final tests the mac stopped turning on, I checked that there was oxidation in the Q7630, I replaced it but with no result.
   Sometimes it wouldn't give led in the MagSafe.
I removed the u6201 to eliminate the possibility of it being defective.

